export const SignIn = ({ navigation }) => {
	return(
		<div class="Form_box">
			<div class="Button_Box">
				<div id="BTN"></div>
				<button type="button" class="Button" onclick="register()">
					Register
				</button>
			</div>
		</div>
	);
};
